window.bookSummaryJSON = "<p>It doesn’t feel like the end. It feels like all of my problems are just beginning.</p> <p>There’s more happening in my town of Raven River than I knew. More lies. More secrets. More pain. Enemies seen and unseen are circling, and not even my guardian angels can protect me.&nbsp;</p> <p>There’s a war coming, and I’ll fight because this time my Angels...my Horsemen...my loves...are the ones who need saving.</p> <p><b><i>The End</i></b><b> is a reverse-harem high-school bully romance. This is the final book in the series and features language, dark themes, and sexual scenes. If you're cool with that, dive in.</b></p>"; 
